script: |
  super -f text -I q6832.spq | sort > q6832.out

inputs:
  - name: q6832.spq
    data: |
      SELECT - 61 + + MIN ( 75 ) AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + 78 / + - col2 NOT BETWEEN col2 * - ( + + col1 ) AND col1 * + 51 * col2;
  - name: tab1

outputs:
  - name: q6832.out
    data: |
      14
